import React from 'react';
import {Button } from 'reactstrap';

class CommentForm extends React.Component{
    render(){
        return (
            <div>
                <Button color="light"><span className="fas fa-pen"></span> Submit Comment</Button>
                
            </div>
            )
    }
}

export default CommentForm
